export default class Operan extends Component {
  render() {
    return (
      <div>
        <h1>Operan Stare yang menjadi Props :{ this.props.makanan}</h1>
        <button onClick = {() => this.setState({makanan: "Soto"})}> Ganti   makanan</button>

      </div>
    );
  }
}
